import React from 'react'
import './PokemonCard.css'

export const PokemonCard = ({name, onClick, image}) => {
  return (
    <button className='card' onClick={onClick}>
      <div className='top'>
        <div className='img-wrapper'>
          {
            image ? <img src={image} alt={name} /> : null
          }

        </div>
      </div>
      <p>{name}</p>
    </button>

  )
}
